import React, { Component } from 'react';
import {Grid} from 'semantic-ui-react';
import './style.scss';

class Dashboard extends Component {
  render() {
    return (
      <Grid>
        <Grid.Colum width={4}>
          <p>a</p>
        </Grid.Colum>
        <Grid.Column>
          <p>sdasd</p>
        </Grid.Column>
      </Grid>
    )
  }
}

export default Dashboard;
